import "./App.css";
import About from "./Components/About/About";
import Footer from "./Components/Footer/Footer";

import Home from "./Home";
import Project from "./Project";
import Service from "./Service";



function App() {
  return (
    <div className="App">
       <Home></Home>
       <About></About>
       <Service></Service>
       <Project></Project>
       {/* <Blog /> */}
       
       <Footer></Footer>
    </div>
  );
}

export default App;
